import main_page6 from"./../../img/main_page6.png";
import main_page7 from"./../../img/main_page7.png";

const Main = () => {
    return (  
      <div className="Main">        
        <div className="text">
          <p>Путеводитель по интересным местам КубГАУ</p>
        </div>

        <div className="Photo">
          <div className="photo photo11">
            <img src={main_page} alt="1"/>
          </div>
          {/* Остальные изображения аналогично... */}
        </div>
        <div className="text1">
          <p>Кубанский государственный аграрный университет - вуз с богатой историей...</p>
        </div>
        <NavLink to="/University">
          <button className="button">
            Увидеть больше!
          </button>
        </NavLink>
      </div>    
    );
  }

  export default Main;
